    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN + col2 * 37 AND ( - 47 * + + 34 );
  - name: tab2

outputs:
  - name: q10808.out
    data: |
      46	51	23
      64	77	40
      75	67	58
